import BBFC_U from '../../../Media/Classifications/BBFC_U.png';

const CC01 = () => {
    return ( 
        <>
          <tr>
            <td><img src={BBFC_U} alt="Universal Rating Logo" width="100%"/></td>
            <td><h3>U Universal - Suitable for all</h3></td>
          </tr>
       </>
     );
}

export default CC01;
